import glom
from collections import Counter


class Solution:

    def counter(self, input: str):
        dict1 = Counter(input)
        return "{A} {C} {G} {T}".format(**dict1)



def test_solution():
    input1 = [(
        dict(input=test1), '224 188 213 227',
    ), (
        dict(input=test2), '224 252 230 250',
    )]

    for input, expect in input1:
        assert Solution().counter(**input) == expect, (input, expect)